(function parseAndCreateIcons(jsonVar, searchText = "", parentElement) {
  let inputObject = JSON.parse(jsonVar);

  let iconArr = inputObject["icons"];

  if (searchText.length > 0) {
    iconArr = iconArr.filter(
      (iconItem) => iconItem.icon.properties.name.indexOf(searchText) > -1
    );
  } else {
    iconArr = iconArr;
  }

  var rootElement = document.getElementById("displayPanel");

  iconArr.forEach((element) => {
    const svgNS = "http://www.w3.org/2000/svg";
    let iconElement = document.createElement("div");

    iconElement.classList.add("style");

    let svgElement = document.createElementNS(svgNS, "svg");
    // svgElement.classList.add("info");

    iconElement.appendChild(svgElement);
    svgElement.setAttribute("width", "28px");
    svgElement.setAttribute("height", "28px");

    element.icon.paths.forEach((path) => {
      let pathElement = document.createElementNS(svgNS, "path");

      pathElement.setAttribute("transform", "scale(0.02 0.02)");
      pathElement.setAttribute("d", path);

      svgElement.append(pathElement);
    });

    rootElement.append(iconElement);
  });
})(jsonVar, "", "");

function fillColor() {
  let selectedColor = document.getElementById("onSelect").value;
  let svgEl = document.querySelectorAll("svg");
  switch (selectedColor) {
    case "red":
      svgEl.forEach((icon) => {
        icon.setAttribute("fill", "#e44141");
      });
      break;
    case "blue":
      svgEl.forEach((icon) => {
        icon.setAttribute("fill", "#3498db");
      });
      break;
    case "green":
      svgEl.forEach((icon) => {
        icon.setAttribute("fill", "#4caf50");
      });
      break;
    case "gray":
      svgEl.forEach((icon) => {
        icon.setAttribute("fill", "#dbe2e5");
      });
      break;
    case "orange":
      svgEl.forEach((icon) => {
        icon.setAttribute("fill", "#f3831f");
      });
      break;
    case "white":
      svgEl.forEach((icon) => {
        icon.setAttribute("fill", "#ffffff");
      });
      break;
  }
}
